{"id": 75, "url": "https://www.apartmentfinder.com/California/Bakersfield-Apartments/The-Villas-At-Scenic-River-Apartments", "title": "The Villas at Scenic River Apartments", "location": "4015 Scenic River Ln, Bakersfield, CA  93308", "rent_special": "", "price_range": "Call for Rent", "beds": "1 - 2", "bath": "1 - 2", "lease_term": "Available months None", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "$35", "cat_deposit": "", "dog_deposit": "", "apartment_description": "The Villas at Scenic River is an independent senior living community for the vibrant 55 and older. Each apartment home offers a single level floor plan with one or two bedrooms and features custom home interiors with two-tone custom paint, designer flooring, in-home washer & dryer, Energy Star appliances with gas cooking, kitchen island and pantry.  Community amenities include a resort-style heated pool with private cabana areas, a community garden, large putting greens and dedicated BBQ & picnic areas. Inside you can take advantage an active social clubhouse and recreation room, state of the art entertainment center with kitchen facilities and a large private dining room for those family reunions and gatherings, a custom fitness and exercise room designed to enhance healthy living or enjoy the computer business center with individual work stations, copier and printer and much more. At The Villas at Scenic River you will discover a world that caters to you. Whether that includes a work/life balance, starting a new life goal or enjoying retirement, you will appreciate the comfort of knowing that good friends, good neighbors and good times are close by and we invite you to experience the lifestyle that is The Villas at Scenic River!", "office_hour": {"Monday": {"time_open": "10AM", "time_close": "4PM"}, "Tuesday": {"time_open": "10AM", "time_close": "5PM"}, "Wednesday": {"time_open": "10AM", "time_close": "5PM"}, "Thursday"